def agent_action(execution_engine, member_id):
    if member_id >= len(execution_engine.current_members):
        return

    me = execution_engine.current_members[member_id]

    # Analyze attack relationships
    victim_matrix = execution_engine.relationship_dict.get('victim', [])
    if member_id >= len(victim_matrix):
        return

    attacks = victim_matrix[member_id]
    attack_counts = {i: attacks[i] for i in range(len(attacks)) if attacks[i] > 0 and i != member_id}

    if not attack_counts:
        # No attacks, offer benefits to strengthen alliances
        for target_id in range(len(execution_engine.current_members)):
            if target_id != member_id:
                execution_engine.offer(me, execution_engine.current_members[target_id], True)
        return

    # Identify the member with the highest attacks against me
    target_id = max(attack_counts, key=attack_counts.get)

    # Check if target member exists
    if target_id >= len(execution_engine.current_members):
        return

    target_member = execution_engine.current_members[target_id]

    # Decide action based on vitality
    if me.vitality < 50.0:
        # Offer help to reduce hostility
        execution_engine.offer(me, target_member, True)
    else:
        # Attack the most hostile member
        execution_engine.attack(me, target_member)

    # Optionally, use bear action if target has land
    benefit_land_matrix = execution_engine.relationship_dict.get('benefit_land', [])
    if benefit_land_matrix and target_id < len(benefit_land_matrix):
        target_land = benefit_land_matrix[target_id]
        if target_land > 0:
            execution_engine.bear(me, target_member)

